script: |
  super -f text -I q11586.spq | sort > q11586.out

inputs:
  - name: q11586.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT ( ( col0 * ( - col0 * - col2 ) + - col2 ) BETWEEN ( col2 * 32 ) AND 98 + col1 * col2 );
  - name: tab2

outputs:
  - name: q11586.out
    data: |
      46	51	23
      64	77	40
      75	67	58
